  false,\n\t\"url\": null,\n\t\"notes\": \"Lead is a wide spread pollutant found at
  low levels worldwide in essentially all animals tested. Lead has been used in hunting
  for hundreds of years and the only documented hazard has been from lead shot accumulating
  in the appendix. However, recent concern about the sensitivity of children and pregnant
  women to lead exposure at levels far lower than previously thought significant raises
  the need to investigate this issue further.\",\n\t\"license_title\": \"License Not
